  \"2015-08-27T08:50:34.714445\",\n\t\"name\": \"anaho-island-national-wildlife-refuge-notes-on-american-white-pelican-population-calenda-1-60357\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains information about
  the American White Pelican population for the Anaho Island National Wildlife Refuge
  in the Stillwater National Wildlife Refuge Complex from calendar years 1961 to 1970.
  Documents within in the collection include handwritten notes, offices memorandums,
  birdscounts, typed reports and aerial photographs. Species covered in the research
  are American White Pelican, Doublecrested Cormorant, Canada Goose, California Gull,
  Caspian Tern, Great Blue Heron, and miscellaneous other birds. Life history of white
  pelicans on Anaho Island is included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
